import logo from './logo.svg';
import './App.css';
import { Button } from 'semantic-ui-react';
import Main from './components/main';
import { Link } from 'react-router-dom';

class App extends Component {
  render() {
    return (
        <button class='ui button' role='button'>
  Click Here
</button>        
    );
  }
}

export default App;
